  constructor(props) {
	super(props);
	this.state = {
  	name: '',
  	email: '',
  	message: ''
	}
  }

  getEmail(event){
  	this.handleSubmit();
  	console.log(this.props.email(event.target.value))
  }

  render(){
    return (
    	<div>
      	<Formular email={this.getEmail}/>
				<button type="button" className="btn btn-primary">Odeslat Dotaz</button>

      </div>
    )
  }


  handleSubmit( event ) {
	  event.preventDefault();
	  console.log(this.state)
	}

}

export default App;
